# FUNCTIONS

def safe_filename_from_url(url: str) -> str:
    parsed = urlparse(url)
    domain = parsed.netloc.replace(":", "_")
    h = hashlib.sha1(url.encode("utf-8")).hexdigest()
    path_snippet = re.sub(r'[^0-9A-Za-z\-_.]', '_', (parsed.path or "").strip("/"))[:40]
    if path_snippet:
        name = f"{path_snippet}_{h}.txt"
    else:
        name = f"{h}.txt"
    return domain, name

